import song from "../../hello.wav";
export default function Latest(){

    const audioElm = useRef();

    return(
        <>
           <div className="song">
            <h3 >Now Playing</h3>
            <audio src="https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview122/v4/db/a6/77/dba677db-5b64-0a2d-c19f-0f18d8fcc040/mzaf_10146298548367866111.plus.aac.ep.m4a" controls ref={audioElm}></audio>
            <button onClick={()=>{ audioElm.current.play();}}>Play</button>
           </div>
        </>
    )
}
